import React, { useEffect } from "react";
import myStyles from './Home.module.css';
import Helmet from 'react-helmet';



const Home = () => {



    return(
        <>
        <Helmet>
            <body />
                <style>
                    {`
                        body{
                            background-color: rgb(244, 234, 206);
                        }
                    `}
                </style>

        </Helmet>
        <h1 className={myStyles.h1}>Home page fro dashboard</h1>

        </>
    )
}

export default Home;
